import React from "react";

const HelpPage = () => {
  return (
    <div
      style={{
        backgroundColor: "black",
        color: "white",
        textAlign: "center",
        padding: "20px",
        fontFamily: "Arial, sans-serif"
      }}
    >
      <h1>Need Assistance?</h1>
      <p>How to diagonise:</p>
      <p>Step-by-step guide on the  process.</p>

      <p>Care Tips:</p>
      <p>Valuable information on care and health.</p>

      <p>Common Issues and Solutions:</p>
      <p>addressing common problems and their solutions.</p>

      <p>Resources and Guides:</p>
      <p>
        Links to useful resources, articles, and guides on
        care.
      </p>
    </div>
  );
};

export default HelpPage;
